INSERT INTO `documents_elements` (`documentId`, `name`, `type`, `data`) VALUES
(5, 'head', 'input', 'Registrierung erfolgreich abgeschlossen'),
(5, 'text', 'wysiwyg', '<p>\n  Hi %Text(firstname); %Text(lastname);,<br/>\n  thanks for registering to our shop.\n</p>\n'),
(6, 'head', 'input', 'Reset Password'),
(6, 'text', 'wysiwyg', '<p>\n  Hi %Text(firstname); %Text(lastname);<br/>\n  <br/>\n  please click on the link to reset your password: %Text(resetLink);\n</p>\n'),
(7, 'head', 'input', 'Confirm Newsletter'),
(7, 'text', 'wysiwyg', '<p>\n  Hi %Text(firstname); %Text(lastname);<br/>\n  <br/>\n  please click on the link to confirm your newsletter subscription: %Text(confirmLink);\n</p>\n'),
(8, 'head', 'input', 'Newsletter subscription confirmed'),
(8, 'text', 'wysiwyg', '<p>\n  Hi %Text(firstname); %Text(lastname);<br/>\n  <br/>\n  your newsletter subscription is now confirmed.\n</p>\n'),
(9, 'head', 'input', 'Order Confirmation %Text(orderNumber);'),
(9, 'text', 'wysiwyg', '<p>\n  Hi %Text(firstname); %Text(lastname);,<br/>\n  your order with the reference %Text(orderNumber); has been received by us.\n</p>\n'),
(10, 'head', 'input', 'Your order has been shipped %Text(orderNumber);'),
(10, 'text', 'wysiwyg', '<p>\n  Hi %Text(firstname); %Text(lastname);,<br/>\n  your order %Text(orderNumber); has been shipped.\n</p>\n'),
(11, 'head', 'input', 'Notes on your order %Text(orderNumber);'),
(11, 'text', 'wysiwyg', '<p>Notes on your order:</p> <p>%DataObject(comment,{\"method\" : \"getDescription\"});</p>\n');
